import React from 'react';
import { useAppContext } from '../../context/AppContext';
import './BookingDetailsModal.css';

const BookingDetailsModal = ({ booking, onClose, onStatusUpdate }) => {
  const { 
    staffList, 
    aircraftList, 
    membersList,
  } = useAppContext();

  const getMemberName = (memberId) => {
    const member = membersList.find(m => m.id === memberId);
    return member ? `${member.firstName} ${member.lastName}` : 'Unknown Member';
  };

  const getStaffName = (staffId) => {
    const staff = staffList.find(s => s.id === staffId);
    return staff ? `${staff.firstName} ${staff.lastName}` : 'Unknown Staff';
  };

  const getAircraftInfo = (aircraftId) => {
    const aircraft = aircraftList.find(a => a.id === aircraftId);
    return aircraft ? `${aircraft.type} (${aircraft.registration})` : 'Unknown Aircraft';
  };

  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="booking-details-modal" onClick={e => e.stopPropagation()}>
        <div className="modal-header">
          <h2>Booking Details</h2>
          <button className="close-btn" onClick={onClose}>Ã—</button>
        </div>
        
        <div className="modal-content">
          <div className="booking-info">
            <div className="info-group">
              <label>Status:</label>
              <span className={`status-badge ${booking.status.toLowerCase()}`}>
                {booking.status}
              </span>
            </div>
            
            <div className="info-group">
              <label>Date & Time:</label>
              <span>{new Date(booking.dateTime).toLocaleString()}</span>
            </div>

            <div className="info-group">
              <label>Member:</label>
              <span>{getMemberName(booking.memberId)}</span>
            </div>

            <div className="info-group">
              <label>Instructor:</label>
              <span>{getStaffName(booking.staffId)}</span>
            </div>

            <div className="info-group">
              <label>Aircraft:</label>
              <span>{getAircraftInfo(booking.aircraftId)}</span>
            </div>

            {booking.comments && (
              <div className="info-group">
                <label>Comments:</label>
                <p>{booking.comments}</p>
              </div>
            )}
          </div>

          <div className="booking-actions">
            {booking.status === 'Unconfirmed' && (
              <>
                <button 
                  className="confirm-btn"
                  onClick={() => onStatusUpdate(booking.id, 'Confirmed')}
                >
                  Confirm Booking
                </button>
                <button 
                  className="cancel-btn"
                  onClick={() => onStatusUpdate(booking.id, 'Cancelled')}
                >
                  Cancel Booking
                </button>
              </>
            )}
            {booking.status === 'Confirmed' && (
              <button 
                className="complete-btn"
                onClick={() => onStatusUpdate(booking.id, 'Complete')}
              >
                Mark as Complete
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default BookingDetailsModal;
